import "./NavBarstyles.css"

import "../../assets/js/help.js"

const NavBar = () => {

	const changeClass = () => {
		alert($(this).scrollTop());
	}
    return (
		<>
        <nav className="nav nav-pills sticky-top flex-column align-items-end" id="sideScrollNavBar">
			<div className="mainNavBar">
				<a className="nav-link chosen" href="#briefInfoSection">Profile</a>
				<a className="nav-link" href="#ExperiencePage"  onClick={changeClass}>Experience</a>
				<a className="nav-link" href="#ProjectsPage">Projects</a>
				<a className="nav-link" href="#LeadershipPage">Leadership</a>
				<a className="nav-link" href="#SkillsPage">Skills</a>
				<a className="nav-link" href="#contactPage">Contact</a>
			</div>
		</nav>



		</>

    )
}

export default NavBar
